import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import background from '../images/background.jpg';
import { Table } from 'reactstrap';

export default class TableTransaction extends React.Component {
	constructor() {
		super();
		this.state = {};
	}

	render() {
		return (
			<div>
				<Table
					size="sm"
					striped
					hover
					responsive
					style={{
						marginTop: '40px',
						backgroundColor: '#F3F5F7'
					}}
				>
					<thead>
						<tr>
							<th>Numéro</th>
							<th>Nom</th>
							<th>Prénom</th>
							<th>Numéro carte</th>
							<th>Montant</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<th scope="row">1</th>
							<td>Mark</td>
							<td>Otto</td>
							<td>@mdo</td>
							<td>10,50€</td>
						</tr>
						<tr>
							<th scope="row">2</th>
							<td>Jacob</td>
							<td>Thornton</td>
							<td>@fat</td>
							<td>99,99€</td>
						</tr>
						<tr>
							<th scope="row">3</th>
							<td>Larry</td>
							<td>the Bird</td>
							<td>@twitter</td>
							<td>29,90€</td>
						</tr>
					</tbody>
				</Table>
			</div>
		);
	}
}
